import "./input.css";

function Input() {
  return (
    <div className="input-wrapper">
      <form onSubmit={e=>e.preventDefault()}>
        <label className="numberLbl">Number : </label>
        <input className="numberInp" type="number" min="10" max="99" />
        <button classname="numberSubmitBtn" type="submit">Update</button>
      </form>
    </div>
  );
}

export default Input;
